import * as d3 from "d3";

export function createRoutine(data, containter, width, height) {
  const parseTime = d3.timeParse("%Y-%m-%dT%H:%M:%SZ");

  // Preprocess the data
  const formattedData = data.map((d) => {
    return {
      participantId: +d.participantId,
      timestamp: parseTime(d.timestamp),
      currentMode: d.currentMode,
    };
  });

  // Group the data by day
  const groupedData = d3.group(formattedData, (d) =>
    d3.timeDay.floor(d.timestamp)
  );

  // Get the unique modes
  const modes = Array.from(new Set(formattedData.map((d) => d.currentMode)));

  // Set up the color scale
  const colorScale = d3.scaleOrdinal().domain(modes).range(d3.schemeCategory10);

  // Set the dimensions of the heatmap
  const rectWidth = width / (1440 / 5); // Five-minute interval for a day (24 hours * 60 minutes / 5 minutes)
  const rectHeight = height / groupedData.size;

  // Create the SVG container
  const svg = d3
    .select(containter)
    .append("svg")
    .attr("width", width)
    .attr("height", height);

  // Add legend group
  const legend = svg
    .append("g")
    .attr("class", "legend")
    .attr("transform", `translate(0, 20)`); // Adjust the y-coordinate as needed

  // Draw the heatmap
  const heatmap = svg
    .selectAll("g")
    .data(Array.from(groupedData))
    .enter()
    .append("g")
    .attr("transform", (d, i) => `translate(0, ${i * rectHeight})`); // Move to the next row for each day

  heatmap
    .selectAll("rect")
    .data((d) => d[1])
    .enter()
    .append("rect")
    .attr("x", (d) => {
      const dayStart = d3.timeDay.floor(d.timestamp);
      const minutesSinceStart = d3.timeMinute.count(dayStart, d.timestamp);
      return (minutesSinceStart * rectWidth) / 5; // Multiply by rectWidth and divide by 5 for five-minute intervals
    })
    .attr("y", 0)
    .attr("width", rectWidth)
    .attr("height", rectHeight)
    .style("fill", (d) => colorScale(d.currentMode));

  // Add x-axis labels for hours
  const xScale = d3
    .scaleTime()
    .domain([
      d3.timeMinute.floor(d3.min(formattedData, (d) => d.timestamp)),
      d3.timeMinute.ceil(d3.max(formattedData, (d) => d.timestamp)),
    ])
    .range([0, width]);

  const xAxis = d3
    .axisBottom(xScale)
    .ticks(d3.timeHour.every(3))
    .tickFormat(d3.timeFormat("%H:%M"));

  svg.append("g").attr("transform", `translate(0, ${height})`).call(xAxis);

  // Add y-axis labels for days
  const yScale = d3
    .scaleTime()
    .domain([
      d3.timeDay.floor(d3.min(formattedData, (d) => d.timestamp)),
      d3.timeDay.ceil(d3.max(formattedData, (d) => d.timestamp)),
    ])
    .range([0, height]);

  const yAxis = d3.axisLeft(yScale).tickFormat(d3.timeFormat("%Y-%m-%d"));

  svg.append("g").call(yAxis);

  // Modify legend position and layout
  const legendItems = legend
    .selectAll(".legend-item")
    .data(modes)
    .enter()
    .append("g")
    .attr("class", "legend-item")
    .attr("transform", (d, i) => `translate(${i * 80}, 0)`); // Adjust the spacing between legend items as needed

  legendItems
    .append("rect")
    .attr("x", 0)
    .attr("y", 0)
    .attr("width", 10)
    .attr("height", 10)
    .style("fill", (d) => colorScale(d));

  legendItems
    .append("text")
    .attr("x", 20)
    .attr("y", 10)
    .attr("dy", "0.35em")
    .text((d) => d);
}


